  React.useEffect(() => {
    setImages(['2', '10', '20', '25'])
    callBackEnd()
  }, [])



  console.log(data)

  return (
    <div className='container'>
      <div className='row justify-content-center mt-2'>Images</div>
      <div className='row mt-5'>{images.map(image => <div className='col-2'>{image}</div>)}</div>
      <div className='mt-5'>{data}</div>
    </div>
  );
}

